VALUES ('3266140061340', 'Pâtes avoines calamars et poivrons', 'Pâtes avoines réhydratées 34% (eau, semoule de ble dur), eau, anneaux de calamars blanchis 12% (calamar 11,7%, eau, sel, acidifiants : acide citrique et citrate de sodium), poivrons grilles 10,4%, crème (stabilisant carraghénanes), huile d\'olive, purée de citron jaune, amidon transformé de pomme de terre, oignons préfrits (oignon, huile de tournesol), sel, piment d\'Espelette AOP, épaississant: gomme xanthane, ail. Peut contenir des traces de : ceuf, fruit à coque, poisson crustace Malgre tout le soin apporté à l\'élaboration de ce plat, la presence de plume (cartilage fin et transparent du calamar) reste possible.', 'https://static.openfoodfacts.org/images/products/326/614/006/1340/front_fr.4.400.jpg', '4.2', '1.6', '16', '1.2', '', '3.9', '0.83', '0.326771653543307', '', '1');

