VALUES ('3266140416034', 'Ravioli aux fromages', 'Verse Pasta met kaasvulling Ingrediënten: Pasta (70%): harde tarwegriesmeel van superieute kwaliteit, water, eieren (140 g per kg griesmeel). Vulling (30%): Kazen 62% (Ricotta, gesmolten kaas (kaas, gemodificeerd zettneel, wei, zout, natuurlijk aroma), Emmental, Roquefort), paneermeel (tarwe), Vater, Zout, petefselie, natuuflijk aroma (melk). Vercentage uitgedfukt VOOf de vulling). Kan spofen bevatten van soja, sesam en noten. Re.reidingsadvies: Pocheef de ravioli 8 minuten in gezouten kokend water en laat ze uitlekken. Naaf wens op smaak maken: tomatencoulis, Parmezaanse kaas of een saus naar keuze. Gemiddelde voedin s aaf e ef 100 Energie: 1037 kJ —', 'https://static.openfoodfacts.org/images/products/326/614/041/6034/front_fr.4.400.jpg', '3.9', '2.5', '38.4', '0.9', '', '10.7', '0.93', '0.366141732283465', '', '1');

