VALUES ('3266191007045', 'Couscous gros', 'couscous GROS à la semoule de blé dur NOS ENGAGEMENTS La Vie Claire Garantie Biologique : La Vie Claire vous propose des produits de qualité issus de l\'Agriculture Biologique, mode de production garantissant des conditions de culture et d\'élevage non polluantes et respectueuses de l\'écosystème. ce produit est certifié par ECOCERT SAS - BP47 - 32600 L\'ISLE-JOURDAIN. De plus, La Vie Claire analyse périodiquement ses produits dans un laboratoire indépendant pour vous garantir leur qualité. Qualité de fabrication : Mets originaire du Maghreb, le couscous La Vie Claire est fabriqué exclusivement à partir de blé dur biologique. La semoule est mélangée avec l\'eau et aggloméree en grains. Précuits et séchés, les grains sont ensuite calibrés en trois fractions : couscous fin, moyen et gros. Intérêt nutritionnel : Le coUscoUs est un aliment source de protéines végétales. Suivant les produits qui accompagnent la recette, on obtient des plats de grandes valeurs nutritives. Conseil de préparation pour 2 personnes : Versez 25 cl d\'eau bouillante sur 250 g de couscous. Laissez gonfler 5 min. Ajout noix de beurre ou un peu d\'huile d\'olive en égrainant le couscous à l\'aide d\'une four( PRODUIT DE L\'AGRICULTURE BIOLOGI UE', 'https://static.openfoodfacts.org/images/products/326/619/100/7045/front_fr.4.400.jpg', '1.8', '0.3', '72', '3.9', '', '13', '0', '0', '', '1');

